import { NavBar } from 'vant';

export default {
  name: 'Header',
  components: {
    'van-header': NavBar
  },
  props: {
    title: String,
    leftText: String,
    rightText: String,
    leftArrow: {
      type: Boolean,
      default: false
    },
    fixed: {
      type: Boolean,
      default: false
    },
    border: {
      type: Boolean,
      default: true
    },
    zIndex: {
      type: Number,
      default: 1
    }
  },
  methods: {
    onClickLeft () {
      this.$router.back();
      this.$emit('click-left');
    },
    onClickRight () {
      this.$emit('click-right');
    }
  }
};
